mapper.select:
select  

from OrderHeader WHERE 1=1
  
     and  SHKCOO = #{shkcoo,jdbcType=VARCHAR}
  
  
     and  SHDOCO = #{shdoco,jdbcType=INTEGER}
  
  
     and  SHDCTO = #{shdcto,jdbcType=VARCHAR}
  
  
     and  SHMCU = #{shmcu,jdbcType=VARCHAR}
  
  
     and  SHCO = #{shco,jdbcType=VARCHAR}
  
  
     and  SHAN8 = #{shan8,jdbcType=INTEGER}
  
  
     and  SHSHAN = #{shshan,jdbcType=INTEGER}
  
  
     and  SHTRDJ = #{shtrdj,jdbcType=DATE}
  
  
     and  SHDRQJ = #{shdrqj,jdbcType=TIMESTAMP}
  
  
     and  SHPDDJ = #{shpddj,jdbcType=DATE}
  
  
     and  SHVR01 = #{shvr01,jdbcType=VARCHAR}
  
  
     and  SHDEL1 = #{shdel1,jdbcType=VARCHAR}
  
  
     and  SHDEL2 = #{shdel2,jdbcType=VARCHAR}
  
  
     and  SHURCD = #{shurcd,jdbcType=VARCHAR}
  
  
     and  SHURDT = #{shurdt,jdbcType=DATE}
  
  
     and  SHURAT = #{shurat,jdbcType=NUMERIC}
  
  
     and  SHURAB = #{shurab,jdbcType=NUMERIC}
  
  
     and  SHURRF = #{shurrf,jdbcType=VARCHAR}
  
  
     and  SHUPMJ = #{shupmj,jdbcType=TIMESTAMP}
  
  
     and  SAMLNM = #{samlnm,jdbcType=NVARCHAR}
  
  
     and  SAADD1 = #{saadd1,jdbcType=NVARCHAR}
  
  
     and  SAADD2 = #{saadd2,jdbcType=NVARCHAR}
  
  
     and  SAADD3 = #{saadd3,jdbcType=NVARCHAR}
  
  
     and  SAADD4 = #{saadd4,jdbcType=NVARCHAR}
  
  
     and  SHMLNM = #{shmlnm,jdbcType=NVARCHAR}
  
  
     and  SHADD1 = #{shadd1,jdbcType=NVARCHAR}
  
  
     and  SHADD2 = #{shadd2,jdbcType=NVARCHAR}
  
  
     and  SHADD3 = #{shadd3,jdbcType=NVARCHAR}
  
  
     and  SHADD4 = #{shadd4,jdbcType=NVARCHAR}
  
  
     and  JDE_UpdateDate = #{jdeUpdatedate,jdbcType=TIMESTAMP}
  
  
     and  KT_ProcessDate = #{ktProcessdate,jdbcType=TIMESTAMP}
  
  
     and  KT_FailDate = #{ktFaildate,jdbcType=TIMESTAMP}
  
  
     and  KT_RetryTimes = #{ktRetrytimes,jdbcType=INTEGER}
  
  
     and  KT_ErrorLog = #{ktErrorlog,jdbcType=VARCHAR}
  
  
     and  FMS_Process_Date = #{fmsProcessDate,jdbcType=TIMESTAMP}

select 

from OrderHeader
where SHKCOO = #{shkcoo,jdbcType=VARCHAR}
  and SHDOCO = #{shdoco,jdbcType=INTEGER}
  and SHDCTO = #{shdcto,jdbcType=VARCHAR}

mapper.delete:
delete from OrderHeader
where SHKCOO = #{shkcoo,jdbcType=VARCHAR}
  and SHDOCO = #{shdoco,jdbcType=INTEGER}
  and SHDCTO = #{shdcto,jdbcType=VARCHAR}
